export default {
  name: 'GroupPerm',
  props: {
    form: {
      type: Object,
      default: function() {
        return {
          username: '',
          name: '',
          email: '',
          phone: ''
        }
      }
    },
    list: {
      type: Array,
      default: () => []
    },
    values: {
      type: Array,
      default: () => []
    }
  },
  data() {
    return {
      permList: this.values
    }
  },
  watch: {
    values() {
      this.permList = this.values
    }
  },
  methods: {
    submitForm() {
      this.$refs.form.validate((valid) => {
        if (valid) {
          this.$emit('submit', this.form.id, this.permList)
        } else {
          return
        }
      })
    },
    cancelForm() {
      this.$emit('cancel')
    }
  }
}
